description:
Verenigde Staten / Duitsland
Thriller / Drama
110 minuten

een verdomt goeie film

met Jamie Foxx, Jennifer Garner en Chris Cooper

Ronald Fleuy (Foxx) leidt een anti-terrorisme eenheid die de verantwoordelijken van een bomaanslag op Amerikaanse burgers in 
het Midden Oosten moet opsporen. Eenmaal in het weinig toegankelijke woestijnland, proberen de Amerikanen een lokale 
politie-officier aan hun kant te krijgen om hun onderzoek te vergemakkelijken. Maar het onderzoek wordt gedwarsboomd door 
bureaucratie en tradities en de levens van Fleury en zijn manschappen staan op het spel.
